import React from 'react';
import './styles/App.css';
import Game from './Game';
import {
	BrowserRouter as Router,
	Switch,
	Route
 } from 'react-router-dom';
import Intro from './Intro';


const App = () => {
	return (
		<Router>
			<Switch>
				<Route path="/pvp">
					<Game />
				</Route>
				<Route path="/">
					<Intro />
				</Route>
			</Switch>
		</Router>
	)
}

export default App;
